import React from 'react';
import logo2 from './logo.svg';

function app_prueba() {
  return (
    <div className="app_prueba">
      <header className="app_prueba-header">
        <img src={logo2} className="app_prueba-logo" alt="logo" />
        <p>
          segundo div.
        </p>
      </header>
    </div>
  );
}

export default app_prueba;
